import react from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import './css/QuemSomos.css'

function Header()
{
    return(
        <div id="QuemSomos">
            <text id="textQuemSomos"> Quem Somos</text>
            <text id="descricao"> Nós somos um cursinho popular que atua desde 2014 em diversas regiões de Campinas</text>
        </div>
    )
}
export default Header
